export default function DigitPanel(){
  return(
    <Link href="/projects/digit_recognizer">
      <>
        <img src={"../../static/DigitRecognizer.png"} alt="Preview of AI project"></img>
        <style jsx>{`
          img{
            display: block;
            margin-left: auto;
            margin-right: auto;
            margin-top: auto;
            margin-bottom: auto;
            max-width: 100vw;
            max-height:90vh;
          }
          `}</style>
      </>
    </Link>
  )
}
